import React from 'react';
// import React, { Fragment } from "react"


const Card = (props) => {
    return (
          <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow5'>
			<img alt='robots'  src={`https://robohash.org/${props.id}?30x50`} />
		<div>
		  	<h2>{props.name}</h2>
		  	<p>{props.email}</p>
		</div>
	</div>
    );
}

export default Card;
